const payload = msg.payload;

function enableIt() {
    if (payload.select[0].status !== 'success') {
        return null;
    }

    const isDevelopModeEnabled = payload.select[0].resultSet[0].STATUS || 'Y';

    if (isDevelopModeEnabled === 'Y') {
        return null;
    }

    const update = `UPDATE OBJETO_SISTEMA SET DS_SCRIPT_CRIACAO = 'create or replace function GET_ENABLED_DEV_MODE return varchar2 is ' ||  chr(10) ||
        'ds_retorno_w	varchar2(1) := ''Y''; ' ||  chr(10) ||
        'begin' ||  chr(10) ||
        'return ds_retorno_w;' ||  chr(10) ||
        'end GET_ENABLED_DEV_MODE;/'
        WHERE NM_OBJETO = 'GET_ENABLED_DEV_MODE'`
    return update;
}

function getDeveloperModeStatus() {
    if (payload.select[0].status !== 'success') {
        return null;
    }

    const tasyVersion = payload.select[0].resultSet[0].VERSION;
    if (tasyVersion === '5.01.1835') {
        return `SELECT GET_ENABLED_DEV_MODE() as status FROM dual`
    }

    return null;
}

function compile() {
    return `CALL TASY_CRIAR_OBJETO_SISTEMA('GET_ENABLED_DEV_MODE', 'WHEB')`
}

function getTasyVersion() {
    return `select  cd_versao as VERSION
            from (
                select  cd_versao
                from    aplicacao_tasy_versao
                where   ie_versao_oficial = 'S'
                order by dt_atualizacao desc
            )
            where rownum = 1
    `;
}

const lastEvent = msg.event;
let query = ''
let event = ''

switch (lastEvent) {
    case 'VERSION':
        query = getDeveloperModeStatus();
        event = 'SELECT';
        break;
    case 'SELECT':
        query = enableIt();
        event = 'UPDATE';
        break;
    case 'UPDATE':
        query = compile();
        event = 'COMPILE';
        break;
    default:
        query = getTasyVersion();
        event = 'VERSION';
        break;

}

msg.topic = query;
msg.event = event;
msg.isObjectFlow = true;

if (msg.payload.headers) {
    msg.headers = msg.payload.headers
}

return msg;
